import {
  Box,
  Button,
  CardContent,
  CircularProgress,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TablePagination
} from "@material-ui/core";
import React, { useEffect, useState } from "react";
import { listUsers } from "../service/UserService";
import axios from  "../service/axios"

export const AppList = () => {
  const [users, setUsers] = useState([]);


  useEffect(async() => { 
    const result = await axios.get('auth/usuarios');
    setUsers(result.data)
   }, []);

  return (
    <div>
           <ul>
      {users.hits.map(item => (
        <li key={item.name}>
          <a href={item.email}>{item.password}</a>
        </li>
      ))}
    </ul>

    </div>
  );
};
